import styled from "styled-components";

export const CardsContainer = styled.div`
    display:flex;
    flex-wrap:wrap;
    width: 70vw;
    justify-content: space-around;
    row-gap: 8px;
    margin-top: 32px;
    cursor: pointer;
    font-family: "Roboto";
    -webkit-font-smoothing: antialiased;
`

export const StyledImg = styled.img`
    width: 246px;
    height: 397px;
    border-radius: 20px;
`
